import React from 'react';
import './Teacher.css'
const TeacherBody = ()=>{
    return(
        <div className='teacherMain'>
            <p>Teacher Name</p>
        <div className='teacherEach'><h2>Niman Maharjan</h2>
        <p>He is very Helpful Teacher.</p></div>
        
        </div>
    )

}

export default TeacherBody;
